window.bookSummaryJSON = "<p>Duet narrated by Andi Eloise and Brandon Francis, this shifter romantasy tale takes listeners on an epic journey of found family, a swoon-worthy rivals to lovers slow burn, and a unique twist on werewolves and vampires that will keep you on the edge of your seat.</p> <p><b><i>Protect the Peace.</i></b></p> <p><i>On the Isle of Kazola, peace has always been protected by The Onyx Guard, an elite force of genetically modified soldiers.</i></p> <p>Kasha has lived her life in the Onyx Guard. But when she is passed over for an advancement and forced to follow the Alpha promoted in her place, she must find a way to put her anger aside and work with him.</p> <p>Because their team is on the hunt for Elliot Wells, an elusive killer who has terrorized Kazola for years. And there is more to his twisted deviance than meets the eye.</p> <p>Along the journey, Kasha must learn to face her past, accept her new reality, and trust others...or else the deaths will continue, and everything she has built for herself might just slip away.</p>"; 
